  insertRule(index: number, rule: string): boolean {
    if (index <= this.length) {
      this.rules.splice(index, 0, rule);
      this.length++;
      return true;
    } else {
      return false;
    }
  }

  deleteRule(index: number): void {
    this.rules.splice(index, 1);
    this.length--;
  }

  getRule(index: number): string {
    if (index < this.length) {
      return this.rules[index];
    } else {
      return '';
    }
  }
}
